Teacher;Tammi;Johnsen;tammijohnsen@gmail.com;20494059;;Thorsensvej 29 ;;Nykøbing Falster ;;4800;Denmark;Service List Wage;;;2002-07-24;;;Bioteknologi A, Tysk B, Engelsk B, Fysik B, Kemi A, Matematik A, Kemi A, Dans C, Dansk A, Dramatik C, Historie A, Idræt C, Oldtidskundskab C, Religion C, Samfundsfag C, SRP, Bioteknologi B, Bioteknologi C, Dansk B, Dansk C, Dansk Folkeskole, Engelsk C, Engelsk Folkeskole, Fysik C, Fysik/kemi Folkeskole, Historie B, Historie C, Historie Folkeskole, Kemi B, Kemi C, Matematik B, Matematik C, Matematik Folkeskole;#13BA7E;;Jeg er motiveret til at undervise, fordi jeg ønsker, at andre kommer til at dele min interesse og kendskab til den verden, vi lever i. Interessen opstår hovedsaglig ved forståelsen af de emner, som jeg ønsker at undervise i. I øjeblikket går jeg i 3.g på Nykøbing F. Katedralskole med studieretningen Bioteknologi og er 18 år gammel. Jeg tilbyder undervisning i matematik, kemi og bioteknologi på C-, B- og A-niveau, samt engelsk C og B da det er meget relevant i vores internationale samfund. Jeg har før undervist i Videnskabsklubben, og deltager årligt i faglige konkurrencer. Personligt har jeg stor glæde af at rejse og interagere i nye kulturelle sammenhænge, f.eks. har jeg været i Kenya i sommeren 2019, hvor jeg bl.a. udøvede frivilligt arbejde og underviste kort i matematik. Jeg har også færdiggjort et toårigt diplomforløb hos Akademiet for Talentfulde Unge øst. Konkret har jeg før hjulpet i matematik, hvor jeg fulgte en elev fra 8.-klasse til 2.g, hendes udvikling blev afspejlet i karakteren, som steg fra 02 og 4 til 7 og 10.;Active;Off;Off;Off;Off;Off;View;Manage;Off;Off;Off;Off;View;Manage;Off;View;On;Enabled;2023-04-22 12:59:09 +0200;115713;2021-02-16 18:55:35 +0100;2021-02-07 20:13:12 +0100;2021-10-22 16:47:41 +0200;Kvinde;Jeg vil ikke have flere forløb i øjeblikket;2407026732;54793813433;;Maple,Geogebra,Excel;STX;;;Engelsk;Resten af mit 3.g år, men forstiller mig umildbart at fortsætte, når jeg starter på uni;7;