Teacher;Clara;Lynggaard;lynggaardclara@gmail.com;30257343;;Skejbygårdsvej 19;;Risskov;;8240;Denmark;Service List Wage;;;2002-08-08;;;Biologi B, Biologi C, Biologi Folkeskole, Dansk A, Dansk B, Dansk C, Dansk Folkeskole, Historie Folkeskole, Idræt B, Idræt C, Matematik Folkeskole, Tysk Folkeskole;#E56032;;Clara er 19 år og til sommer søger hun ind på medicinstudiet i Aarhus. Hun brænder for at kunne videregive sin viden fra gymnasiet samt folkeskolen til andre børn og unge. Clara er en smilende og glad person, der i hverdagen arbejder i et lille bageri i Fredericia. Derudover er hun svømmetræner i Fredericia Svømmeklub. Her har Clara fundet ud af, at hun nyder og brænder for at undervise, da hun elsker at se andre udvikle sig både personligt og fagligt. Hun interesserer sig for sport og musik samt fagene dansk, tysk, idræt, matematik og biologi. Hun ser frem til at møde sine kommende elever og følge dem i deres udvikling  :-).;Active;Off;Off;Off;Off;Off;View;Manage;Off;Off;Off;Off;View;Manage;Off;View;On;Enabled;2022-09-15 18:30:24 +0200;135519;2021-11-23 13:37:07 +0100;2021-10-26 19:32:57 +0200;2022-08-09 08:21:34 +0200;Kvinde;Jeg vil ikke have flere forløb i øjeblikket;080802-6198;3193-3193297803;11 til 12;Maple,Geogebra,Excel;STX;;;;Til 16. august. 2022.;2-5 timer;;;1;Google;1;;1;Fredericia Gymnasium;Jeg er færdig med gymnasiet;;;;;;;
